PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE m_card_passive_skill_original(
  card_master_id INTEGER NOT NULL,
  skill_level INTEGER NOT NULL,
  position INTEGER NOT NULL,
  name TEXT NOT NULL,
  passive_skill_master_id INTEGER NOT NULL,
  PRIMARY KEY (card_master_id, skill_level, position),
  FOREIGN KEY (card_master_id) REFERENCES m_card(id),
  FOREIGN KEY (passive_skill_master_id) REFERENCES m_passive_skill(id)
);
COMMIT;
